<script type="text/javascript">//<![CDATA[
    XHR.poll(5, '<%=url([[admin]], [[vpn]], [[shadowsocksr]], [[run]])%>', null,
            function (x, data) {
                var tb = document.getElementById('shadowsocksr_status');
                var tb1 = document.getElementById('google_status');
                var tb2 = document.getElementById('baidu_status');
                var tb3 = document.getElementById('ss_server_status');
                var tb4 = document.getElementById('ssr_server_status');
                var tb5 = document.getElementById('v2_server_status');        
                if (data && tb) {
                    if (data.global) {
                        tb.innerHTML = '科学上网<br><span class="green">运行正常✔</span>';
                    } else {
                        tb.innerHTML = '科学上网<br><span class="red">未运行✘</span>';
                    }
                    if (data.google) {
                        tb1.innerHTML = '国外网站<br><span class="green">访问正常✔</span>';
                    } else {
                        tb1.innerHTML = '国外网站<br><span class="red">无法访问✘</span>';
                    }
                    if (data.baidu) {
                        tb2.innerHTML = '国内网站<br><span class="green">访问正常✔</span>';
                    } else {
                        tb2.innerHTML = '国内网站<br><span class="red">无法访问✘</span>';
                    }
                    if (data.ss_server) {
                        tb3.innerHTML = 'SS服务器<br><span class="green">运行正常✔</span>';
                    } else {
                        tb3.innerHTML = 'SS服务器<br><span class="red">未运行✘</span>';
                    }
                    if (data.ssr_server) {
                        tb4.innerHTML = 'SSR服务器<br><span class="green">运行正常✔</span>';
                    } else {
                        tb4.innerHTML = 'SSR服务器<br><span class="red">未运行✘</span>';
                  }
                    if (data.v2_server ) {
                        tb5.innerHTML = 'V2服务器<br><span class="green">运行正常✔</span>';
                    } else {
                        tb5.innerHTML = 'V2服务器<br><span class="red">未运行✘</span>';
  

                    }
                }
            }
    );
//]]>
</script>
